import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, TextField, Button } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

const RemainingStudentsName = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [students, setStudents] = useState([]);

    useEffect(() => {
        const fetchStudents = async () => {
            try {
                const response = await fetch('http://localhost:9999/students');
                const data = await response.json();
                // Assuming the data is an array of student objects
                const filteredStudents = data.filter(student => student.S_match === 'แยกคู่โครงงาน');
                setStudents(filteredStudents);
            } catch (error) {
                console.error('Error fetching students:', error);
            }
        };

        fetchStudents();
    }, []);

    const handleSearch = (e) => {
        setSearchTerm(e.target.value);
    };

    const filteredStudents = students.filter(student =>
        student.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        student.StudentID.includes(searchTerm)
    );

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div style={{ textAlign: 'center', marginTop: '50px' }}>
                                <h2>รายชื่อนักศึกษา CSB ที่ตกค้าง</h2>
                                <TextField
                                    label="ค้นหา"
                                    variant="outlined"
                                    style={{ marginBottom: '20px' }}
                                    value={searchTerm}
                                    onChange={handleSearch}
                                />
                                <TableContainer component={Paper}>
                                    <Table>
                                        <TableHead>
                                            <TableRow>
                                                <TableCell>ลำดับ</TableCell>
                                                <TableCell>รหัสนักศึกษา</TableCell>
                                                <TableCell>ชื่อ นามสกุล</TableCell>
                                                <TableCell>สถานะโครงงาน</TableCell>
                                                <TableCell>ลิงค์</TableCell>
                                            </TableRow>
                                        </TableHead>
                                        <TableBody>
                                            {filteredStudents.map((student, index) => (
                                                <TableRow key={student.StudentID}>
                                                    <TableCell>{index + 1}</TableCell>
                                                    <TableCell>{student.StudentID}</TableCell>
                                                    <TableCell>{student.name}</TableCell>
                                                    <TableCell>{student.status}</TableCell>
                                                    <TableCell>
                                                        <Button variant="contained" color="primary" href={student.link} target="_blank">ดูรายละเอียด</Button>
                                                    </TableCell>
                                                </TableRow>
                                            ))}
                                        </TableBody>
                                    </Table>
                                </TableContainer>
                            </div>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
};

export default RemainingStudentsName;
